import React, { Component } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';



class Header extends React.Component {
  render() {
    return (
      <div class="header">
        <header className="container">
        <script>
          AOS.init();
        </script>
          <h1 data-aos="fade-in" data-aos-offset="200" data-aos-easing="ease-in-sine" data-aos-duration="600">
            > Let's get you sleeping right!</h1> 
          <br/>
          <br/>
          <p>
            ... or keep scrolling to learn more about the science of sleep!
          </p>
          <br/>
          <br/>
          <button>When should I Zzzzz</button>
        <button >Let me see how I did</button>
        <h1 data-aos="fade-up">When should you sleep?</h1>

        </header>
      </div>
    );
  }
}

export default Header;
